import './App.css';
import SearchBar from './components/search'
import React from "react"; 

function App() {
  return (
    <div className="App">
      <div className="HeaderStyle" style={{backgroundImage:'url(roadMapBackGround.webp")'}}>
          <img src="planetImage.png" width="200" height="200" alt='planetImage'/>
          <h1 style={{color: "white" , margin: "60px"}}>Country Search</h1>
      </div>
      <header className="App-header">
        <SearchBar/>
      </header>
      <div className="App-body">
      </div>
    </div>
  );
}
export default App;
